const RegisterCompView = ({ userName, password, onUserNameChange, onPasswordChange, onSubmit, message, setShowRegister }) => (
    <div>
        <form onSubmit={onSubmit}>
            <h2 className="h2">Registro</h2>
            <input
                id="userName"
                type="text"
                placeholder="Usuario"
                value={userName}
                onChange={onUserNameChange}
                required
            />
            <input
                id="password"
                type="password"
                placeholder="password"
                value={password}
                onChange={onPasswordChange}
                required
            />
            <button type="submit">
                Registrar
            </button>
            {message && (
                <p className="text-green-600 text-sm mt-2 text-center">{message}</p>
            )}
        </form>
        <button onClick={() => setShowRegister(false)}>
            ¿Ya tienes cuenta? Inicia sesión
        </button>
    </div>

);
export default RegisterCompView;
